    return (
        <Navigate>
            <Link to="/home" style={{ñ}}>
                <Linked>Home</Linked>
            </Link> 
            <Link to="/about">
                <Linked>About</Linked>
            </Link>
            <SearchBar onSearch={props.onSearch}/>
        </Navigate>
